/// <reference path="cordova.signature.d.ts" />

module Csterm {
    "use strict";

    export class WebSignature implements ISignatureCordova {
        private window: any;
        myQ: ng.IQService;

        constructor($q: ng.IQService) {
            if (<any>window) {
                this.window = (<any>window);
            }
            this.myQ = $q;
        }

        init(buttonNames) {
            var defer = this.myQ.defer();
            defer.resolve();
            return defer.promise;
        }

        getSignature(text) {
            var defer = this.myQ.defer();
            /* tslint:disable */
            var base64ImgMock = 'data:image/png;base64,';
            /* tslint:enable */
            defer.resolve(base64ImgMock);
            return defer.promise;
        }

        getTransparentSignature(text) {
            var defer = this.myQ.defer();
            /* tslint:disable */
            var base64ImgMock = 'data:image/png;base64,';
            /* tslint:enable */
            defer.resolve(base64ImgMock);
            return defer.promise;
        }

    }

    export class CordovaSignature implements ISignatureCordova {
        private window: any;
        myQ: ng.IQService;
        constructor($q: ng.IQService) {
            if (<any>window) {
                this.window = (<any>window);
            }
            this.myQ = $q;
        }

        init(buttonNames) {
            var defer = this.myQ.defer();
            this.window.cordova.plugins.signaturePlugin.init(
                (success) => {
                    defer.resolve(success);
                }, () => {
                    defer.reject();
                }, buttonNames
            );
            return defer.promise;
        }
        getSignature(text) {
            var defer = this.myQ.defer();
            this.window.cordova.plugins.signaturePlugin.getSignature(
                (success) => {
                    defer.resolve(success);
                }, () => {
                    defer.reject();
                }, text
            );
            return defer.promise;
        }

        getTransparentSignature(text) {
            var defer = this.myQ.defer();
            this.window.cordova.plugins.signaturePlugin.getTransparentSignature(
                (success) => {
                    defer.resolve(success);
                }, () => {
                    defer.reject();
                }, text
            );
            return defer.promise;
        }

    }
}
